window.bookSummaryJSON = "<p>Payback is owed.</p> <p>And Maddie Clayton is going to collect. This time Carlos and Logan have gone too far. People are dead, lives have been changed, and she’s had enough. Plus, she’s got the devil on her side, so when an enemy turns into a friend with an idea of how to take Carlos down, she’s in.</p> <p>Tyler Morgan has been fighting back his whole adult life. He’s ready for anything when it comes to payback. But endangering Maddie can’t be part of the deal. Unfortunately for him, once Maddie gets an idea in her head, there’s no stopping her.</p> <p>Her debt has been paid in blood, and she wants revenge.</p> <p>His fight is still there, but now he’s got more at stake than himself.</p> <p>The end is coming.</p> <p>But even if they win against Carlos, they can still lose each other.</p>"; 
